function Preview(rate, price, url){
    return(
        <div className='preview'>
            <p className='rate'>{rate}<img src='/images/star_new.png'/></p>
            <p className='price'>{price} грн</p>
            <img src={url}/>
        </div>
    );
}

export default Preview;
